import React,{useContext} from 'react'
import { contextData } from './Context'
import './blogStyles.css'
import { Advertise } from './Advertise'

export const TopFeaterudArts = () => {
    const [data] = useContext(contextData) 
    // console.log(data[0].title,data[1].id);
    // const oneData =data.filter((x)=>x.id<4);
    const data1=[];
    const data2=[];
    data.forEach(k=> {
    switch (k.id) {
        case "1":
            data1.push(data[k.id-1]);
            console.log(data1);
            break;
        case "2":
            data2.push(data[k.id-1]);
            console.log(data2);
            break;
        case "3":
            data2.push(data[k.id-1]);
            console.log(data2);
            break;
        default:
            break;

    }  
    });


    return (
        <>
            <div className="Topfetrd">
            {
                data1.map((a)=>
                    <div  >
                        <img src={a.image}/>
                        <p>{a.title}</p>
                        <p>{a.category}/{a.date}</p>
                    </div>
                )
            }
            </div>
            <div className='sideBox'>
            {
                data2.map((a)=>
                    <div >
                        <img src={a.image}/>
                        <p>{a.title}</p>
                        <p>{a.category}/{a.date}</p>
                    </div>
                )
            }
            </div>
        </>
    )
}
